function greatestCommonDivisorOfStrings() {
    let str1 = ""
    let str2 = ""

    let a = Math.max(str1.length, str2.length)
    let b = str1.length != a ? str1.length : str2.length 

    while (b != 0) {
        let temp = b
        b = a % b
        a = temp
    }

    return str1 + str2 == str2 + str1 ? str1.substring(0, a) : ""
}

console.log(greatestCommonDivisorOfStrings())
